import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import AboutSection from './components/AboutSection';
import FeaturesSection from './components/FeaturesSection';
import Footer from './components/Footer';

// Placeholder pages for each feature
function AIPoweredChatbot() {
  return <div style={{ padding: '2rem' }}><h2>AI-Powered Chatbot</h2><p>Chat window goes here!</p></div>;
}
function VirtualMuscat() {
  return <div style={{ padding: '2rem' }}><h2>Virtual Muscat Assistant</h2><p>Real-time style advice & TTS here!</p></div>;
}
function CustomAvatar() {
  return <div style={{ padding: '2rem' }}><h2>Customizable Avatar</h2><p>Ready Player Me iFrame goes here!</p></div>;
}
function PhotoUpload() {
  return <div style={{ padding: '2rem' }}><h2>Photo Upload & Fit Suggestions</h2><p>Image upload & analysis here!</p></div>;
}
function SeasonalGuides() {
  return <div style={{ padding: '2rem' }}><h2>Seasonal Fashion Guides</h2><p>Summer/Winter/Rainy outfit suggestions here!</p></div>;
}
function OutfitCosmetics() {
  return <div style={{ padding: '2rem' }}><h2>Outfit & Cosmetics Matching</h2><p>Complete looks & makeup alignment here!</p></div>;
}
function ExpertTips() {
  return <div style={{ padding: '2rem' }}><h2>Expert Tips & Articles</h2><p>Styling advice from professionals here!</p></div>;
}
function DirectShopping() {
  return <div style={{ padding: '2rem' }}><h2>Direct Shopping Links</h2><p>Affiliate store integration coming soon!</p></div>;
}
function CustomProfiles() {
  return <div style={{ padding: '2rem' }}><h2>Customizable Profiles</h2><p>Personal user preferences, sizes, style goals here!</p></div>;
}

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        {/* HOME ROUTE */}
        <Route path="/" element={
          <>
            <Hero />
            <AboutSection />
            <FeaturesSection />
            <Footer />
          </>
        } />

        {/* 9 FEATURES ROUTES */}
        <Route path="/ai-chatbot" element={<AIPoweredChatbot />} />
        <Route path="/virtual-muscat" element={<VirtualMuscat />} />
        <Route path="/custom-avatar" element={<CustomAvatar />} />
        <Route path="/photo-upload" element={<PhotoUpload />} />
        <Route path="/seasonal-guides" element={<SeasonalGuides />} />
        <Route path="/outfit-cosmetics" element={<OutfitCosmetics />} />
        <Route path="/expert-tips" element={<ExpertTips />} />
        <Route path="/direct-shopping" element={<DirectShopping />} />
        <Route path="/profiles" element={<CustomProfiles />} />
      </Routes>
    </Router>
  );
}

export default App;
